import React from 'react';

const TestCard = ({test}) => {

    return (
        <div className="col-6">
            <form>
                <div className="m-2">
                    <p>{test?.question}</p>
                    <label name={test?.id}>
                        {test?.answers?.map( it => {
                            return(
                                <>
                                    <input type="radio" name={it} value={it} id={it.id}/>
                                    <label htmlFor={it.id}>{it}</label>
                                </>
                            )
                        } )}
                    </label>
                </div>
            </form>
        </div>
    )
}

export default TestCard;
